import React ,{ useEffect }from 'react'
import './App.css'

function App() {
  return (
    <HashRouter>
        <div>
            <Title title="功能選單" />
            <ul>
                <li><Link to='/radomColor'>隨機變色</Link></li>
                <li><Link to="/sameColor">相同顏色</Link></li>
            </ul>
        </div>
    </HashRouter>
  )
}

export default App;
